import React from "react";

export default function Store({ elem }) {
  return (
    <div>
      <p
        style={{
          border: "1px solid black",
          flex: 1,
          textAlign: "center",
          fontSize: "24px",
        }}
      >
        <div style={{ fontWeight: "bold" }}>{elem.name}</div>

        <br />

        {elem.Opening_Hours}
        <br />
      </p>
    </div>
  );
}
